import './section4.css';
import Ul from './ul'

const section4 = () => {

    const list1 = ['About us', 'Team', 'Careers', 'Swiggy Blog', 'Bug Bounty', 'Swiggy Super', 'Swiggy Corporate', 'Swiggy Instamart'];
    const list2 = ['Help & Support', 'Partner with us', 'Ride with us'];
    const list3 = ['Terms & Conditions', 'Refund & Cancellation', 'Privacy Policy', 'Cookie Policy', 'Offer Terms', ''];

    return ( 
        <div className="section4">
            <div className="outter">
                <Ul listarray = {list1}/>
                <Ul />
                <Ul />
            </div>
        </div>
     );
}

export default section4;
